import EventsNavigation from "../components/EventsNavigation";
import { Outlet } from "react-router-dom";
export default function EventsRootLayout({children}) {
  return (
    <>
      <EventsNavigation>
        <Outlet>{children}</Outlet>
      </EventsNavigation>
    </>
  );
}
